import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLinkedinIn } from '@fortawesome/free-brands-svg-icons';
import {
	solid,
	regular,
	brands,
	icon,
} from '@fortawesome/fontawesome-svg-core/import.macro';

function App() {
	return (
		<div>
			<div className="outer-rectangle center">
				<div className="top-rectangle top-center"></div>
				<div className="inner-rectangle inner-center"></div>
				<div className="socials-center">
					<div className="socials">
						<FontAwesomeIcon icon={faLinkedinIn} size="lg" />
					</div>
					<div className="socials">Github</div>
					<div className="socials">Mail</div>
				</div>
			</div>
			<div className="circle circle-center"></div>
			<div className="inner-circle circle-center"></div>
		</div>
	);
}

export default App;
